INSERT INTO `application_accessoriestype` VALUES (3,'Handles','We offer a wide range of affordable and high-quality fitted kitchen door knobs and door handles. Select from a vast choice of styles and finishes available exclusively online.','Description','Fitted Kitchen Handles & Knobs | Available Online','handles'),(4,'Sinks & Taps','Upgrade your kitchen with our stylish and durable kitchen sinks and taps. We provide a wide collection of bowl sinks and sink mixers at very competitive prices.','Description','Modern Fitted Kitchen Sinks & Taps UK | Fast Delivery','sinks-taps'),(5,'Lighting','Our latest lighting products will work in any type of kitchen. We offer affordable Kitchen lights, including led panel lights, ceiling lights and under cabinet lighting.','Description','Latest Kitchen lighting ideas UK | Buy products Online','lighting'),(6,'Bins','Keep your kitchen clean and tidy with our stylish waste bins. We offer an affordable wide range of bins including Steel Waste Bin, Pull out Bin, Single & Duo and Recycling Bin.','Description','High-Quality Fitted Kitchen Waste Bins | Built-in and Integrated','bins'),(7,'Wirework','We offer a high-quality and affordable solution for fitted kitchen storage, including tall larders units and corner units. Quick Delivery of stocked items.','Description','Kitchen Units Wirework in new fitted kitchens','wirework'),(8,'Cutler Tray','Browse our range of kitchen cutlery trays. We offer Carbon Fiber and scoop cutlery trays to improve your kitchen storage. Low Price & Fast Delivery of stocked items.','Description','Carbon Fiber Kitchen Cutlery Trays for drawers','cutler-tray');
