INSERT INTO `application_appliances` VALUES (435,'MONTPELLIER INT61NT\n60CM INDUCTION FITTED HOB','Built in','Montpellier','Our INT61NT 60cm induction hob is the perfect edition to your kitchen if your looking for a 4 zone hob with a stylish design and heats the contents of your pan up quickly. The induction technology means the pan* is heated directly rather than wasting energy heating the cooking surface, this is how it is able to heat up quicker than a ceramic hob would. There is also little residual heat from the cooking surface which means spills can be quickly wiped up soon after cooking. **Pan must have a high iron content due to induction working on magnetism.)','Appliance/Hobs_3',199,'Hob',1,0,1,'Our INT61NT 60cm induction hob is the perfect edition to your kitchen if your looking for a 4 zone hob with a stylish design and heats the contents of your pan up quickly. ','description','MONTPELLIER INT61NT\n60CM INDUCTION FITTED HOB'),(436,'MONTPELLIER MGH90CX\nSTAINLESS STEEL 90CM GAS FITTED HOB','Built in','Montpellier','Montpellier 86cm Stainless Steel Gas Hob with Custom Cast Iron Pan Supports, Auto Iginition and comes complete with a 2 Year Guarantee.\n\n5 Burners\nCast Iron Pan Supports\nAuto Ignition\nLPG Convertible with Kit Included\nFlame Failure Safety Device','Appliance/Hobs_4',235,'Hob',1,0,1,'Montpellier 86cm Stainless Steel Gas Hob with Custom Cast Iron Pan Supports, Auto Iginition and comes complete with a 2 Year Guarantee.','description','MONTPELLIER MGH90CX\nSTAINLESS STEEL 90CM GAS FITTED HOB'),(437,'MONTPELLIER MGH75CX\nSTAINLESS STEEL 70CM GAS HOB','Built in','Montpellier','Add a dash of sophistication to your work surface with the Montpellier MGH75CX 70cm stainless steel hob.\n\nCustom cast iron pan supports set this model apart, offering durability and contemporary style. Five burners including a large wok burner in the middle give you versatile cooking options as and when required.\n\n5 x Gas Burners\nCast Iron Pan Supports\nAuto Ignition\nLPG Convertible with Kit Included\nFlame Failure Safety Device\nDimensions H x W x D (mm) 107 x 700 x 500','Appliance/Hobs_5',229,'Hob',1,0,1,'Add a dash of sophistication to your work surface with the Montpellier MGH75CX 70cm stainless steel hob.','description','MONTPELLIER MGH75CX\nSTAINLESS STEEL 70CM GAS HOB'),(438,'MONTPELLIER MGH61CX\nSTAINLESS STEEL 60CM GAS HOB','Built in','Montpellier','The Montpellier MGH61CX hob has four gas burners including a wok burner which are operated via front rotary controls.\n\nThere are also cast iron pan supports to ensure stability to your pots and pans as well as featuring auto ignition.\n\nThe MGH61CX also features flame failure protection. This means that should one of the gas flames be extinguished, the flame failure device will stop the supply of any further gas to the burner until it is reignited.\n\n4 x Burner Gas Hob\nCast Iron Pan Supports\nAuto Ignition\nFlame Failure Safety Device\nFront Controls\nDimensions H x W x D (mm) 90 x 580 x 500','Appliance/Hobs_6',149,'Hob',1,0,1,'The Montpellier MGH61CX hob has four gas burners including a wok burner which are operated via front rotary controls.','description','MONTPELLIER MGH61CX\nSTAINLESS STEEL 60CM GAS HOB'),(439,'MONTPELLIER  INT31NT\n30CM INDUCTION HOB','Built in','Montpellier','The Montpellier INT31T 30cm induction domino hob is the perfect addition to your kitchen if you lack cooking space and want a stylish design. It also allows you the flexibility to mix and match your cooking styles to create a modern combination design.\n\nThe induction technology also means the pan is heated directly rather than wasting energy heating the cooking surface. As a result of this, food heats up quickly and there is little residual heat from the cooking surface.\n\n2 induction cooking zones\nHot hob indicator\nTouch control\nDimensions H 62 x W 288 x D 520mm','Appliance/Hobs_7',125,'Hob',1,0,1,'The Montpellier INT31T 30cm induction domino hob is the perfect addition to your kitchen if you lack cooking space and want a stylish design. ','description','MONTPELLIER  INT31NT\n30CM INDUCTION HOB'),(440,'MONTPELLIER MGB60X STAINLESS STEEL 60CM SIDE CONTROL GAS FITTED HOB','Built in','Montpellier','The Montpellier MGH60X 60cm stainless steel gas hob is the perfect edition to your kitchen if your looking for stylish yet practical. The stainless steel hob comes with 4 burner zones and enamel  pan supports, making it resilient to wear and tear. \n\n4 Gas Burners\nEnamel Pan Supports\nAuto Ignition\nLPG Convertible with Kit Included\nFlame Failure Safety Device','Appliance/Hobs_8',129,'Hob',1,0,1,'The Montpellier MGH60X 60cm stainless steel gas hob is the perfect edition to your kitchen if your looking for stylish yet practical. ','description','\nMONTPELLIER MGB60X STAINLESS STEEL 60CM SIDE CONTROL GAS FITTED HOB'),(441,'MONTPELLIER MGH75BG BLACK GAS ON GLASS 70CM HOB','Built in','Montpellier','Add a dash of sophistication to your work surface with the MGH75BG 70cm gas on glass hob.\r\n\r\nCustom cast iron pan supports set this model apart, offering durability and contemporary style. Five burners including a large wok burner in the middle give you versatile cooking options as and when required.\r\n\r\nIt has auto ignition to turn on without fuss, and rotary controls at the front of the hob ensure it is easy to adjust the heat as you need.\r\n\r\n5 x Burner Gas Hob (Adjustable For LPG)\r\nCast Iron Pan Supports\r\nAutomatic Ignition\r\nLPG Kit Included\r\nDimensions H x W x D (mm) 100 x 700 x 510','Appliance/Hobs_9',229,'Hob',1,0,1,'Add a dash of sophistication to your work surface with the MGH75BG 70cm gas on glass hob.Custom cast iron pan supports set this model apart, offering durability and contemporary style.','description','MONTPELLIER MGH75BG BLACK GAS ON GLASS 70CM HOB'),(465,'MONTPELLIER MDI505\nSLIMLINE FULLY INTEGRATED DISHWASHER','Built In','Montpellier ','The MDI505 Fully Integrated 45cm Slimline dishwasher hides nicely behind a cupboard door. Simple and straightforward, this appliance has no complicated settings. Simply load the machine, select the required program and away you go. Although it is slimline it features a top cutlery tray that has individual grooves for every item, meaning cleaner, brighter and shinier cutlery.\n\n8 Programmes\n 6 Wash Temperatures\n 49dB Noise Level\n Top Cutlery Tray\n 30 Min Quick Wash','Appliance/Dishwashers_3',339,'SLIMNLINE DISHWASHER',2,0,1,'The MONTPELLIER  MDI505 Fully Integrated 45cm Slimline dishwasher hides nicely behind a cupboard door.','description','MONTPELLIER MDI505\nSLIMLINE FULLY INTEGRATED DISHWASHER'),(466,'MONTPELLIER  MDI705\nFULLSIZE FULLY INTEGRATED DISHWASHER','Built In','Montpellier ','Don\'t let the washing up get in the way. The Montpellier  MDI705 Fully Integrated 60cm dishwasher has a quick-wash program which cleans your dishes in just 30 minutes.\n\n12 Place Settings\n 9 Programmes\n 5 Wash Temperatures\n Internal Light\n Adjustable Racking','Appliance/Dishwashers_4',335,'FULL SIZE DISHWASHER',2,0,1,' The Montpellier  MDI705 Fully Integrated 60cm dishwasher has a quick-wash program which cleans your dishes in just 30 minutes.','description','MONTPELLIER  MDI705\nFULLSIZE FULLY INTEGRATED DISHWASHER'),(467,'MONTPELLIER  MDI805FULLSIZE FULLY INTEGRATED 15 PLACE SETTING DISHWASHER','Built In','Montpellier','The MONTPELLIER  MDI805 Fully Integrated 60cm dishwasher has a quick-wash program which cleans your dishes in just 30 minutes. It also has an Info LED display which shines a light onto your worktop to indicate the current status of the dishwasher during washing.\r\n\r\nNeatly hidden behind a standard cupboard door is the MDI805 full size integrated dishwasher.\r\n\r\n15 Place Settings\r\n 9 Programmes\r\n Info LED\r\n Cutlery Tray\r\n 1/2 Load Button','Appliance/Dishwashers_5',379,'FULL SIZE DISHWASHER',2,0,1,'The MONTPELLIER  MDI805 Fully Integrated 60cm dishwasher has a quick-wash program which cleans your dishes in just 30 minutes.','description','MONTPELLIER  MDI805 FULLSIZE FULLY INTEGRATED DISHWASHER'),(468,'MONTPELLIER MAB6015R60CM FREESTANDING RETRO DISHWASHER IN RED','Freestanding','Montpellier','Make a statement with the MAB6015R 60cm wide red dishwasher, which features a 1950s retro design. \r\n\r\nIt can hold 15 place settings, and will wash them effortlessly with a variety of programmes and temperatures. Programmes include Quick 30 mins 40c, Eco, Super 50mins 65c, Delicate 40c and Easy Care 60c.\r\n\r\nPlace Settings: 15\r\n1950\'s retro style\r\nAdjustable racking\r\nCutlery Tray\r\nDimensions (mm): H 850 x D 598 x W 598','Appliance/Dishwashers_6',363,'FULL SIZE DISHWASHER',2,0,1,'Make a statement with the MAB6015R 60cm wide red dishwasher, which features a 1950s retro design. It can hold 15 place settings, and will wash them effortlessly with a variety of programmes.','description','MONTPELLIER MAB6015R60CM FREESTANDING RETRO DISHWASHER IN RED'),(469,'MONTPELLIER DW1065W\n WHITE SLIMLINE DISHAWSHER','Freestanding','Montpellier ','The Montpellier DW1065W Freestanding Slimline Dishwasher is a stylish, functional and energy efficient product ideal for the time-precious modern home. No complicated settings or gadgets; simply load the machine, select the required program and away you go. Slimline dishwashers are perfect for homes with limited space or where it only needs to be used for a few items.\n\nWith a 10 place setting capacity, adjustable racking including glass supports and cutlery basket, it offers generous space for all of your dishwashing needs.\n\n10 place settings\n6 programmes\nAdjustable racking','Appliance/Dishwashers_7',279,'SLIMNLINE DISHWASHER',2,0,1,'The Montpellier DW1065W Freestanding Slimline Dishwasher is a stylish, functional and energy efficient product ideal for the time-precious modern home.','description','MONTPELLIER DW1065W\n WHITE SLIMLINE DISHAWSHER'),(492,'Montpellier DDCH90\nMONTPELLIER STAINLESS STEEL 90CM DOWN DRAUGHT COOKER HOOD','Built in','Montpellier ','With just one touch, the Montpellier DDCH90 Downdraft Cooker Hood rises from the worktop behind your hob and begins its high performing extraction. The perfect choice for space-saving, the design makes it an ideal alternative for low ceilings, island units, or when space is at a premium.\nIt gives your kitchen a seamless contemporary look and does away with the need for wall-based extraction. The motor is cleverly hidden in the unit underneath the worktop. It has 4 extraction speeds, a programmable timer, 2 LED lamps and touch controls. You have the ability to alter the brightness of the lights to suit your home.  The Timer is also programmable, allowing you to select between 5, 10, 15, 20, 25, 30, 35 and 40 minutes  when the timer is done, the hood switches off the lights, stops extracting and gently lowers itself into your kitchen counter.','Appliance/Cooker_Hood_3',465,'Cooker hoods',6,0,1,'The perfect choice for space-saving, the design makes it an ideal alternative for low ceilings, island units, or when space is at a premium.','description','MONTPELLIER DDCH90\nSTAINLESS STEEL 90CM DOWN DRAUGHT COOKER HOOD'),(493,'Montpellier DDCH60\nMONTPELLIER STAINLESS STEEL 60CM DOWN DRAUGHT COOKER HOOD','Built in','Montpellier ','With just one touch, the Montpellier DDCH60 Downdraft Cooker Hood rises from the worktop behind your hob and begins its high performing extraction. The perfect choice for space-saving, the design makes it an ideal alternative for low ceilings, island units, or when space is at a premium.\nIt gives your kitchen a seamless contemporary look and does away with the need for wall-based extraction. The motor is cleverly hidden in the unit underneath the worktop. It has 4 extraction speeds, a programmable timer, 2 LED lamps and touch controls. You have the ability to alter the brightness of the lights to suit your home.  The Timer is also programmable, allowing you to select between 5, 10, 15, 20, 25, 30, 35 and 40 minutes  when the timer is done, the hood switches off the lights, stops extracting and gently lowers itself into your kitchen counter.','Appliance/Cooker_Hood_4',405,'Cooker hoods',6,0,1,'With just one touch, the Montpellier DDCH60 Downdraft Cooker Hood rises from the worktop behind your hob and begins its high performing extraction. ','description','MONTPELLIER DDCH60\nSTAINLESS STEEL 60CM DOWN DRAUGHT COOKER HOOD'),(494,'Montpellier CHT991CRMONTPELLIER CREAM T-SHAPED COOKER HOOD','Built in','Montpellier','If youre looking to add a splash of colour to your kitchen, the CHT991CR 90cm T-shaped hood will be the ideal choice. The cream colour is sure to earn some compliments and help create a stylish focal point in your kitchen. This cooker hood has easy-to-use push button controls, and the aluminium filters included will help reduce the grease and odours in the air to help keep your kitchen smelling fresh.','Appliance/mon-cht991cr_600x600.jpg',249,'Cooker hoods',6,0,1,'The cream colour is sure to earn some compliments and help create a stylish focal point in your kitchen. This cooker hood has easy-to-use push button controls.','description','MONTPELLIER CHT991CRCREAM T-SHAPED COOKER HOOD'),(495,'MONTPELLIER CHT991PB\nPASTEL BLUE T-SHAPED COOKER HOOD','Built in','Montpellier ','The montpellier CHT991PB is an essential addition to your kitchen if you are looking for a modern and stylish cooker hood.\n\nThe pastel blue colour is sure to earn some compliments and help create a stylish focal point in your kitchen.\n\nWith easy to use push button controls enabling you to switch between the three available speeds and a maximum extraction speed of 580m3/h, your kitchen will be kept smelling clean and fresh. Also helping to reduce the odours found in their air are the washable aluminium filters.\n\nAlso included are two LED lights to help illuminate your cooking area.','Appliance/Cooker_Hood_6',239,'Cooker hoods',6,0,1,'The montpellier CHT991PB is an essential addition to your kitchen if you are looking for a modern and stylish cooker hood.\n\nThe pastel blue colour is sure to earn some compliments and help create a stylish focal point in your kitchen.','description','MONTPELLIER CHT991PB\nPASTEL BLUE T-SHAPED COOKER HOOD'),(496,'Hotpoint PHC77FLBIX\nHOTPOINT STAINLES STEEL 70CM CHIMNEY HOOD','Built in','Hotpoint','Purify your cooking area with style and powerful three-speed extraction thanks to the Hotpoint Built-In Box Hood in Stainless Steel (PHC7.7FLBIX). Featuring a Booster setting for when you need extra oomph to clear the kitchen of unwanted smells, this model uses two charcoal filters to catch grease, controlled via an easy-to-use Electric Button Interface.\n\nLED lighting not only looks great, it is the brightest and most energy efficient lighting available. Light up the entire surface of your hob without shadows with LED lighting, which also offers 90% energy savings, last 10 times longer, and emits less heat than conventional lamps.','Appliance/Cooker_Hood_7',239,'Cooker hoods',6,0,1,'Purify your cooking area with style and powerful three-speed extraction thanks to the Hotpoint Built-In Box Hood in Stainless Steel (PHC7.7FLBIX). ','description','Hotpoint PHC77FLBIX\nHOTPOINT STAINLES STEEL 70CM CHIMNEY HOOD'),(497,'MONTPELLIER MHG600BK\nBLACK 60CM A RATED CURVED GLASS CHIMNEY HOOD','Built in','Montpellier ','The MHG600BK is a black 60cm curved glass chimney hood that is sure to make your kitchen look modern and stylish. The push button controls are easy to use and it comes complete with a cable and 3 pin plug for easy installation. It also has an A energy rating making it so much kinder to the environment.','Appliance/Cooker_Hood_8',129,'Cooker hoods',6,0,1,'The MHG600BK is a black 60cm curved glass chimney hood that is sure to make your kitchen look modern and stylish.','description','MONTPELLIER MHG600BK\nBLACK 60CM A RATED CURVED GLASS CHIMNEY HOOD'),(498,'MONTPELLIER MH700BK\nBLACK 70CM A RATED CHIMNEY HOOD','Built in','Montpellier ','Montpellier MH700BK Black 70cm A Rated Chimney Hood\n\nThe Montpellier MH700BK cooker hood is ideal you\'re looking for a stylish and effective hood that can clear the air in a large kitchen.\n\nWith easy to use push button controls you can choose between each of the three speed settings with a maximum air flow rate of 450m3/h. You can even choose to have the steam ducted or re-circulated.\n\nAlso included is one 1.5 Watt LED light to illuminate your cooking area and washable aluminium filter cassettes to ensure your kitchen stays smelling fresh and clean.','Appliance/Cooker_Hood_9',125,'Cooker hoods',6,0,1,'The Montpellier MH700BK cooker hood is ideal you\'re looking for a stylish and effective hood that can clear the air in a large kitchen.\n','description','MONTPELLIER MH700BK\nBLACK 70CM A RATED CHIMNEY HOOD'),(499,'MONTPELLIER MAB2035K\nBLACK RETRO STYLE UNDER COUNTER FRIDGE FREEZER','Freestanding','Montpellier','If you want the retro look but dont have the space, Montpelliers MAB2035K mini retro under counter fridge freezer is the perfect solution. It features a 1950s sleek and stylish handle.\n\n1950\'s retro style\n Fridge Light\n Fridge: 62Ltr / Freezer: 26Ltr\n In-Door Can Dispenser\n Icebox Freezer','Appliance/Refrigeration_3',219,'FRIDGE FREEZER',4,0,1,'If you want the retro look but dont have the space, Montpelliers MAB2035K mini retro under counter fridge freezer is the perfect solution.','description','MONTPELLIER MAB2035K\nBLACK RETRO STYLE UNDER COUNTER FRIDGE FREEZER'),(500,'MONTPELLIER MS175W\nWHITE 170CM FRIDGE FREEZER','Freestanding','Montpellier','If youre looking for a tall fridge freezer to fit your weekly shop in, the MONTPELLIER MS175W fridge freezer will help you with that. It comes with a salad crisper drawer perfect for keeping your fruit and veg fresh, and has adjustable glass shelves to help fit any awkward items in that you may have.\n\nThe 50/50 split also means there is plenty of space for your frozen items too.\n\nFridge Capacity Litres (Net) = 1