M MINI RANGE COOKER'),(524,'MONTPELLIER SBFO59BBLACK SINGLE ELECTRIC FAN FITTED OVEN','Built In','Montpellier','Our SBFO59B Slim Depth Single Fan Oven has a good 59 litre capacity with TruFan.\r\n\r\nWith 5 functions, grill at the top of the oven, 1 wire rack and 1 grill pan included, this oven has everything you need to keep cooking simple.\r\n\r\nSlim Depth (531mm)\r\n5 Functions\r\nFitted with Cable\r\nRotary Control with Minute Minder\r\nFitted with cable\r\nA Energy\r\nCapacity (ltr): 59 Ltr','Appliance/Cooking_6',205,'ELECTRIC OVEN',5,0,1,'Our MONTPELLIER SBFO59B Slim Depth Single Fan Oven has a good 59 litre capacity with TruFan.With 5 functions, grill at the top of the oven, 1 wire rack and 1 grill pan included.','description','MONTPELLIER SBFO59BBLACK SINGLE ELECTRIC FAN FITTED OVEN'),(525,'MONTPELLIER MWBIC90044STAINLESS STEEL BUILT IN COMBINATION FITTED MICROWAVE','Built In','Montpellier','Montpellier Built-in Digital Combi Microwave, Massive 44ltr Capacity, Touch Control & Pull Down Door. Along with Auto Cooking Programmes & 3D Hot Air On with cooling fan.\r\n\r\nIntegrated Combi\r\nStainless Steel\r\n900W Microwave/1100W Grill/2400W Convection\r\nPull Down Door\r\n3D Hot Air Oven','Appliance/Cooking_7',429,'MICROWAVE',5,0,1,'Montpellier Built-in Digital Combi Microwave, Massive 44ltr Capacity, Touch Control & Pull Down Door. Along with Auto Cooking Programmes & 3D Hot Air On with cooling fan.','description','MONTPELLIER MWBIC90044 BUILT IN COMBINATION FITTED MICROWAVE'),(526,'MONTPELLIER MWBIC74B\nBLACK BUILT IN COMBINATION FITTED MICROWAVE','Built In','Montpellier','The MWBIC74B integrated combi microwave is perfect for those who love cooking as it cooks in a similar way to a conventional oven, giving you that extra cavity space to meet all your cooking needs.\n\nThis microwave offers the perfect balance of function and style with its 44Ltr capacity,6 power levels, defrost by weight setting, electronic clock and touch and dial controls.\n\nLED Display\n900W Microwave/1750W Grill/1750W Convection\n6 Power Levels\nPull Down Door\nBlack','Appliance/Cooking_8',439,'MICROWAVE',5,0,1,'The MWBIC74B integrated combi microwave is perfect for those who love cooking as it cooks in a similar way to a conventional oven, giving you that extra cavity space to meet all your cooking needs.','description','MONTPELLIER MWBIC74B\nBLACK BUILT IN COMBINATION FITTED MICROWAVE'),(527,'MONTPELLIER MWBI90025STAINLESS STEEL 25L BUILT IN FITTED MICROWAVE WITH GRILL','Built In','Montpellier','Montpellier Built-in Digital Microwave & Grill, 25ltr Capacity, Complete with Trim Kit with 4mm Gap\r\n\r\nIntegrated Microwave and Grill\r\nStainless Steel\r\n900w/1000w\r\n5 Power Leads','Appliance/Cooking_9',199,'MICROWAVE',5,0,1,'Montpellier Built-in Digital Microwave & Grill, 25ltr Capacity, Complete with Trim Kit with 4mm Gap.\r\n\r\nIntegrated Microwave and Grill, Stainless Steel, 900w/1000w','description','MONTPELLIER MWBI90025 25L BUILT IN FITTED MICROWAVE'),(528,'HOTPOINT DU2540WH\nWHITE BUILT UNDER DOUBLE FAN FITTED OVEN\n','Built In','Hotpoint','Delve into bigger culinary adventures with the super capacity of the Hotpoint Built-Under Electric Double Oven. Enjoy 59L of capacity in the top oven and three automatic functions to facilitate Multi-Level Cooking, Slow Cooking and Defrosting with ease.\n\nWithin the top oven, as well as an extra 37L of cooking space, choose between traditional cooking and grilling. Including three shelves plus a grill pan and a triple glazed door to reduce heat loss, the Hotpoint Built-Under Double Electric Oven offers everything you need for creating tasty dishes.','Appliance/Cooking_10',259,'ELECTRIC OVEN',5,0,1,' the HOTPOINT DU2540WH Built-Under Double Electric Oven offers everything you need for creating tasty dishes.','description','HOTPOINT DU2540WH\nWHITE BUILT UNDER DOUBLE FAN FITTED OVEN\n'),(529,'HOTPOINT DU2540BL\nBLACK BUILT UNDER FITTED DOUBLE FAN OVEN\n','Built In','Hotpoint','With two ovens to hand and a grill, this Hotpoint double oven comes in great whether you\'re cooking for one or the whole family. The 59L main oven delivers reliable cooking with even results no matter where you place your dish inside, it\'s all thanks to the circulaire fan which distributes heat beautifully throughout the oven. The fan also enables the oven to heat up faster and it reduces cooking times by 20%. This bottom oven cavity has four functions in total so there\'s something to suit every dish, it even has a defrost function which comes in great if you\'ve forgotten to defrost food the night before.\n\nThe top 37L secondary oven offers conventional cooking, where the top of the oven will always be the hottest. It\'s a great money saver if you\'re only cooking for one as you\'ll save energy. It also has a variable grill, which means you can adjust the heat range to suit your dish, again saving more energy. When it\'s switched off and you\'re cooking in the lower main oven, why not use the top oven to warm your plates as the heat rises from the lower oven.\n\nThis stylish double oven is designed to be built-in, you can install it underneath your worktop or within a kitchen column for easy access. All in black, it adds a modern touch to your space. It features simple and easy to use knob controls with a few push buttons to control the timer. You\'ll never over cook a dish again as you can set this oven to automatically switch off once the cooking period has finished or just use the timer as a simple countdown.','Appliance/Cooking_11',359,'ELECTRIC OVEN',5,0,1,'With two ovens to hand and a grill, this Hotpoint double oven comes in great whether you\'re cooking for one or the whole family. The 59L main oven delivers reliable cooking with even results no matter where you place your dish inside.','description','HOTPOINT DU2540BL\nBLACK BUILT UNDER FITTED DOUBLE FAN OVEN\n'),(530,'MONTPELLIER SFGP12\nBLACK FITTED OVEN AND GAS ON GLASS HOB PACK\n','Built In','Montpellier','In the Montpellier SFGP12 pack, weve paired together two great products to give you one that offers outstanding cooking results, time after time. The electric 56Ltr Oven has 5 functions, an analogue minute minder, oven lamp, 1 wire rack & grill pan + handle. Finished in black and with an A energy rating.\nThe 4 burner gas on glass hob comes with front rotary controls and custom cast iron pan supports in black.\n\nIntegrated TruFan Oven & Gas on Glass Hob\n56Ltr Capacity (Net)\n4 Zone Gas On Black Glass Hob\nBlack Glass Panel on Oven\nCast Iron Pan Supports','Appliance/Cooking_12',339,'ELECTRIC OVEN',5,0,1,'In the Montpellier SFGP12 pack, weve paired together two great products to give you one that offers outstanding cooking results, time after time.','description','MONTPELLIER SFGP12\nBLACK FITTED OVEN AND GAS ON GLASS HOB PACK\n'),(531,'MONTPELLIER SFOM69MXSTAINLESS STEEL MULTIFUNCTION FITTED OVEN WITH MIRROR GLASS DOOR','Built In','Montpellier','The SFOM69MX is a stylish single oven with a mirror glass door, illuminated pop-in pop-out controls and a white LCD screen. The telescopic runners with stabilisers allow hot food to be easily and safely taken out of the oven and the TruFan technology means the warm air is distributed evenly resulting in more even cooking and perfectly cooked food.\r\n\r\nMultifunction\r\n65Ltr Capacity\r\nTelescopic Runner with Stabilisers\r\nSoft Close Door\r\nIlluminated Pop-In Pop-Out Controls','Appliance/Cooking_13',299,'ELECTRIC OVEN',5,0,1,'The SFOM69MX is a stylish single oven with a mirror glass door, illuminated pop-in pop-out controls and a white LCD screen.','description','MONTPELLIER SFOM69MX FITTED OVEN'),(532,'MONTPELLIER SFO67MBXBLACK WITH STAINLESS STEEL TRIM SINGLE MULTIFUNCTION FITTED OVEN','Built In','Montpellier','The SFO67MBX is a stylish single oven with a stainless steel trim, soft close door and illuminated pop-in pop-out controls. This oven also has TruFan technology which means the warm air is distributed evenly resulting in more even cooking and perfectly cooked food.\r\n\r\nMultifunction\r\nSoft Close Door\r\nCatalytic Back Liner\r\nWhite LED Programmable Timer\r\nIlluminated Pop-In Pop-Out Controls','Appliance/Cooking_14',299,'ELECTRIC OVEN',5,0,1,'The SFO67MBX is a stylish single oven with a stainless steel trim, soft close door and illuminated pop-in pop-out controls.','description','MONTPELLIER SFO67MBXBLACK SINGLE MULTIFUNCTION FITTED OVEN'),(533,'MONTPELLIER SFO73B\n SINGLE BLACK BUILT IN FITTED OVEN','Built In','Montpellier','Montpelliers SFO73B has a 70Ltr, 8 function oven offering a bigger oven cavity whilst still giving you all the flexibility you could want from an oven. It has a full touch control panelas well as a  programmable timer which allows you to set your oven to start cooking when convenient for you, so you could have dinner ready for when you get home. The cavity has also an easy clean enamel lining so spills are easier to wipe up.\n\nMultifunction Oven\nTouch Control Panel\nLED Display\nTruFan Oven\nTriple Glazed Glass Door','Appliance/Cooking_15',319,'ELECTRIC OVEN',5,0,1,'Montpelliers SFO73B has a 70Ltr, 8 function oven offering a bigger oven cavity whilst still giving you all the flexibility you could want from an oven. I','description','MONTPELLIER SFO73B\n SINGLE BLACK BUILT IN FITTED OVEN'),(534,'HOTPOINT SA2540HIX STAINLESS STEEL DIAMOND CLEAN SINGLE BUILT IN FITTED OVEN','Built In','Hotpoint','You won\'t need to use harmful chemicals to clean your oven with hydro cleaning. It makes it much easier to tackle stubborn dirt, and the planet will thank you for not using harsh chemicals.\r\n\r\nMultiflow technology is a new style of convection system that delivers an even heat-flow which maintains even temperature throughout the cavity, no matter which shelf you\'re using. The electronic temperature control helps to prevent temperature fluctuations so that you get consistent heat to cook your meal.\r\n\r\nSave time and effort from cleaning as this Hotpoint SA2540HIX Built-In Single Oven features enamel liners which prevent food and mess from burning onto the sides of your oven.\r\n\r\nFor hassle free maintenance, add water to the base of your oven and enable the Hydro Clean function, which will generate steam at 90C for 35 minutes for sparkling results.','Appliance/Cooking_16',229,'ELECTRIC OVEN',5,0,1,'Save time and effort from cleaning as this Hotpoint SA2540HIX Built-In Single Oven features enamel liners which prevent food and mess from burning onto the sides of your oven.','description','HOTPOINT SA2540HIX SINGLE BUILT IN FITTED OVEN'),(535,'MONTPELLIER SBFO59XSTAINLESS STEEL SINGLE ELECTRIC FAN FITTED OVEN','Built In','Montpellier','Our SVFO59X Slim Depth Single Fan Oven has a good 59 litre capacity with TruFan.\r\n\r\nWith 5 functions, grill at the top of the oven, 1 wire rack and 1 grill pan included, this oven has everything you need to keep cooking simple.','Appliance/Cooking_17',229,'ELECTRIC OVEN',5,0,1,'Our SVFO59X Slim Depth Single Fan Oven has a good 59 litre capacity with TruFan.With 5 functions, grill at the top of the oven, 1 wire rack and 1 grill pan included,','description','MONTPELLIER SBFO59XSTAINLESS STEEL SINGLE ELECTRIC FAN FITTED OVEN'),(536,'MONTPELLIER  SBFO65X\nSTAINLESS STEEL SINGLE TRUFAN ELECTRIC FITTED OVEN','Built In','Montpellier','The SBFO65X Single Electric Oven has a 65 litre capacity with TruFan and a temperature range from 50 to 250 degrees.\n\nWith five functions including Eco, rotary controls, a minute minder and a grill, it has everything you need to keep cooking simple.\n\nThe double glazed glass door has a removable plate, making cleaning this appliance really easy.\n\nThe Forced Cooling System means it cools down quickly after being turned off.\n\nThis model comes with a grill tray and wire rack.','Appliance/Cooking_18',209,'ELECTRIC OVEN',5,0,1,'The SBFO65X Single Electric Oven has a 65 litre capacity with TruFan and a temperature range from 50 to 250 degrees.','description','MONTPELLIER  SBFO65X\nSTAINLESS STEEL SINGLE TRUFAN ELECTRIC FITTED OVEN');
