lt'),(73,'This new kitchen combines the latest style trend of slim frame fitted kitchens & real timber. It gives modern and simple look for your new kitchen. This slim frame fitted Kitchen comes with a painted matt finish and Solid ash frame. The fitted kitchen is available in Indigo, Dust Grey, Ivory and Light Grey.','Dust-Grey',NULL,'https://drive.google.com/file/d/1FNmKnGCSaS-SvPbwDYoF8x5V-zF1xRpb/view?usp=sharing','https://drive.google.com/file/d/1g64HCR2G43djKqbcC-hvYKXMJj7tj0Hp/view?usp=sharing','https://drive.google.com/file/d/1LfzDD5aJIEaIOGFENWY6GM4_9aBfaJ0K/view?usp=sharing',12,'Dust-Grey','Dust-Grey','kitchen/new_slim_frame_dust_grey_kitchen.jpg',1,NULL,'alt'),(74,'This new kitchen combines the latest style trend of slim frame fitted kitchens & real timber. It gives modern and simple look for your new kitchen. This slim frame fitted Kitchen comes with a painted matt finish and Solid ash frame. The fitted kitchen is available in Indigo, Dust Grey, Ivory and Light Grey.','Ivory',NULL,'https://drive.google.com/file/d/1FNmKnGCSaS-SvPbwDYoF8x5V-zF1xRpb/view?usp=sharing','https://drive.google.com/file/d/1g64HCR2G43djKqbcC-hvYKXMJj7tj0Hp/view?usp=sharing','https://drive.google.com/file/d/1LfzDD5aJIEaIOGFENWY6GM4_9aBfaJ0K/view?usp=sharing',12,'Ivory','Ivory','kitchen/new_slim_frame_ivory_kitchen.jpg',1,NULL,'alt'),(75,'This new kitchen combines the latest style trend of slim frame fitted kitchens & real timber. It gives modern and simple look for your new kitchen. This slim frame fitted Kitchen comes with a painted matt finish and Solid ash frame. The fitted kitchen is available in Indigo, Dust Grey, Ivory and Light Grey.','Light Grey',NULL,'https://drive.google.com/file/d/1FNmKnGCSaS-SvPbwDYoF8x5V-zF1xRpb/view?usp=sharing','https://drive.google.com/file/d/1g64HCR2G43djKqbcC-hvYKXMJj7tj0Hp/view?usp=sharing','https://drive.google.com/file/d/1LfzDD5aJIEaIOGFENWY6GM4_9aBfaJ0K/view?usp=sharing',12,'Light Grey','Light Grey','kitchen/new_slim_frame_light_grey_kitchen.j