INSERT INTO `application_kitchencategory` VALUES (2,'Oxford Shaker Kitchens','If you love a radiating warm kitchen with rustic charm, this classic fitted kitchen is the style for you and it still retains a contemporary look. It practically complements any space, kitchen, or house.','Description','New Modern Shaker fitted kitchen designs'),(3,'Lucente Handleless Gloss Kitchens','Gloss finished fitted kitchens with a superior lacquered finish for that pristine finish.  Our kitchens are available online in a wide range of designs and styles.','Description','Modern High Gloss fitted Kitchen Units'),(4,'Lucente Handleless Matt kitchens','Our latest matt kitchen cabinets come with easy to clean doors. This handleless style is available in a range of styles and colour options.','Description','New Designer Matt Kitchen Cabinets'),(5,'Cambridge Shaker Kitchens','Our new traditional fitted kitchen brings new life to any kitchen. Our kitchens come with unlimited color options and full installation service.','Description','Traditional Cotswold kitchen cupboards | Manufactured in UK'),(6,'Cartmel Shaker Kitchens','Our traditional fitted kitchens work perfectly if you are looking for a kitchen style that lasts, hand painted in any colour at the fraction of a bespoke kitchen.','Description','New Traditional fitted Kitchen Cabinets | Traditional Designs'),(7,'Windsor Shaker Kitchens','Our Luxury bespoke kitchens create extravagant, beautiful and functional kitchens. These bespoke kitchens are made with high quality materials and exquisitely designed.','Description','Modern & Luxury Kitchens that look bespoke | Available Online'),(8,'Vivo+ Matt Kitchens','We offer an extravagant range of high quality matt finished kitchen units designed for you. These high quality new kitchens provide a stylish finish to any kitchen.','Description','New Matt fitted kitchen Units | Unlimited colour options'),(9,'Vivo+ Gloss Kitchens','Discover our amazing variety of High Gloss Kitchens cabinets. Upgrade your kitchen for less with UK manufactured high quality kitchen units.','Description','Latest High Gloss Kitchen Cabinets and Units'),(10,'Vivo+Gloss for vero system','Our new Designer handleless gloss kitchens are effortlessly graceful and stylish. These high gloss kitchens have modernist design that offer both practicality and elegance.','Description','Designer handleless Gloss Kitchen Cabinets & Doors'),(11,'Vivo+Matt for vero system','Explore our modern handleless fitted kitchens to find a design you\'ll fall in love with. Our kitchens come with unlimited colour options and customization.','Description','New handleless matt Kitchen Cabinets | Full installation'),(12,'New Market Shaker Kitchen','This new kitchen combines the latest style trend of slim frame fitted kitchens & real timber. It gives a modern and simple look to your new kitchen.','Description','Slim Frame New Fitted Kitchens UK | Unlimited Colours');
/*!40000 ALTER TABLE `application_kitchencategory` ENABLE KEYS */;
