INSERT INTO `application_metainfo` VALUES (1,'TKC Kitchens  High quality gloss kitchens at competitive prices','description','TKC Kitchen provides the UK market with the finest Italian modern and traditional quality kitchens. We provide off the shelf and customized kitchen units and doors. Free delivery all over the UK and free design service.','Kitchen Styles - Latest kitchens with countless colours','description','We have the perfect kitchens to match your style. Explore our vast collection of modern and traditional kitchens including Lucente, Vivo, Vivo+ Gloss, Cambridge, Cartmel, Oxford, Windsor and much more.','Worktops - Range of finishes to fit any kitchen colour scheme','description','Worktops are the basis for unique and stylish kitchen designs. We offer elegant Solid Wood Worktops, Laminate Worktops, Solid Laminate Worktops, and Solid Surface Worktops.','Appliances  Get the top brands kitchen appliances','description','Upgrade your kitchen with appliances and products from top brands including Hotpoint, Montpellier and Neff. We offer a wide collection of Laundry, Refrigeration, Cooking and Dishwashing appliances. Quick Delivery of stocked items in 7-10 days.','Design Service - Perfect kitchen designs for you','description','We provide personalized kitchen designs that balance style & functionality. Free Advice on planning your new kitchen. Paint to order in any colour. Book an Appointment with Our Kitchen Experts Today.','Installation Services - With us, every step is seamless','description','We provide exceptional custom-designed kitchens combined with an experienced installation service. We carry out full installation services (Removing an old kitchen, electrical work, plumbing work and minor building works).','Contact Us','description','We are an online kitchen company. For the appointment of showroom visits, please Call Us Now at 0800 211 8289 or email us at service@tkckitchens.co.uk.','Accessories','Accessories','Accessories');
