INSERT INTO `application_metastatic` VALUES (1,'2021 New Kitchen Design Ideas - Unit Prices from 1500','description','Our stylish new kitchens and latest kitchen ideas are available online with unlimited colour choices and prices kept in stock for fast delivery.','UK Brand New Fully Fitted Kitchens Near You','description','Explore our range of brand new fully fitted kitchens for 2021. We might be cheaper than other kitchen companies but we dont compromise on quality.','Get Free Kitchen Design Service | Book an Appointment Now','description','Free Advice on planning your new kitchen. Personalized kitchen designs that balance style & functionality. Book an Appointment with Our Kitchen Experts Today.','Full Kitchen Installation Services near You | Expert Fitters','description','We offer professional full kitchen installation service including Removing an old kitchen, electrical work, plumbing work and minor building works.','Contact us now to get information about latest offers and products','description','We are an online kitchen company. For the appointment of showroom visits, please Call Us Now at 0800 211 8289 or email us at service@tkckitchens.co.uk.','UK Latest Kitchen trends | Modern Styles | Colours to Choose','description','We uncover the Latest Kitchen trends to inspire and help you make most informed decisions. Learn about modern and new kitchen designs and ideas, colour choices and costs involved in the new kitchen.','Cancellation Policy | TKC Kitchens','description','Our Cancellation Policy forms part of and must be read in conjunction with, website Terms and Conditions. We reserve the right to change this Cancellation Policy at any time.','Cookies Policy of our website','description','By continuing to use our site and services, the user is agreeing to the use of cookies and similar technologies for the purposes we describe in this cookies policy.','Our Website Disclaimer Policy','description','Our Disclaimer Policy forms part of and must be read in conjunction with, website Terms and\r\nConditions. We reserve the right to change this Disclaimer at any time.','Frequently Asked Questions regarding our kitchens','description','This is the page of Frequently Asked Questions, which contains the answer to a variety of issues including kitchen cost, guaranty, showrooms, design service &amp; order time.','Our Privacy Policy for website users','description','We respect the privacy of our users and every person who visits our sites www.tkckitchens.co.uk. we are committed to protecting your personal information and your right to privacy.','Intellectual Property Rights Notification','description','We respect the rights of copyright owners to control the uses of their intellectual property and require users of our websites and services to do the same.','Our Kitchens Return and Refund Policy','description','Our Return and Refund Policy forms part of and must be read in conjunction with, website Terms and Conditions. We reserve the right to change this Refund Policy at any time.','Shipping and Delivery Policy for our Kitchen units','description','Our Shipping and Delivery Policy forms part of and must be read in conjunction with, website Terms and Conditions. We reserve the right to change this Shipping and Delivery Policy at any time.','Our Terms And Conditions for kitchens','description','By accessing and using this Website, the User acknowledges that he has read, understood, and agree to be lawfully bound by our Terms and Conditions.','We offer full kitchen installation services making the whole process of new kitchen installation hassle-\r\nfree. our representative will get in touch with you in 24 hours.','description','Hire our Kitchen Installation Services','Login to view Prices of new modern kitchen units and get access to our latest kitchen offers and prices. Our representative will get in touch with you in 24 hours.','description','Log in to view our latest prices and offers','Signup on our website to get access to our latest modern kitchen offers and view Prices for new fitted kitchens. Our representative will get in touch with you in 24 hours.','description','Signup now to get access to the latest offers &amp; view prices','Search for worktops, appliances, accessories, and modern fitted kitchens. (www.tkckitchens.co.uk)','description','Search - Worktops - Appliances - Kitchens','Add new kitchen units, kitchen accessories, appliances, and worktops to your wishlist so you can come back later.','description','Add accessories ,appliances, worktops to your Wishlist');
