INSERT INTO `application_worktop_category` VALUES (1,'Wood Worktops','Get high-quality solid wood worktops at affordable prices in the UK.  We offer Black Oak, Caramel, Bamboo Worktops, Iroko Worktops, Maple Worktops, Oak Worktops, Solid Ash Worktops, Solid Beech Worktops, Solid Walnut Worktops, and Zebrano Worktops.','Description','High-quality Solid Wood Kitchen Worktops','wood-worktops'),(2,'Laminate Worktops','Get high-quality Laminate Worktops at competitive prices in the UK.  We offer durable Black Granite, Black Quartz, Black, Grey Granite, Concrete, Cream, Oak Effect, Walnut and White Worktops.','Description','Durable Laminate Kitchen Worktops','laminate-worktops'),(3,'Stone Worktops','Get high-quality stone worktops at affordable prices in the UK. We supply all stone worktops Marble, Granite, Quartz and Onyx. We supply branded and unbranded stone worktops.','Description','High-quality Stone Kitchen Worktops','stone-worktops'),(4,'Solid Laminate Worktops','We offer high-quality solid Laminate Worktops at competitive prices in the UK. Solid Laminate is available in Caldeira Zenith, Cloudy Cement Zenith, Concrete, Grey Marble, Grey Sparkle, Magma Zenith, Marble Veneto Zenith and White Quartz colours.','Description','Grey Solid Laminate kitchen Worktops','solid-laminate-worktops'),(5,'Solid Surface Worktops','We offer high-quality solid surface Worktops at competitive prices in the UK. Alpine, Arctic, Caledonia, Canella, Carrara, Ferrato, Twilight colours.','Description','Solid Surface kitchen worktops in the UK','solid-surface-worktops');
